import React, { Component } from 'react';
import AppBar from '@material-ui/core/AppBar';
import { withStyles, withTheme } from '@material-ui/core/styles';
import { Typography } from '@material-ui/core';
import Toolbar from '@material-ui/core/Toolbar';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import Hidden from "@material-ui/core/Hidden";
import AccountCircleIcon from '@material-ui/icons/AccountCircle';
import ImportContactsRoundedIcon from '@material-ui/icons/ImportContactsRounded';
import Fade from '@material-ui/core/Fade';
import MenuIcon from '@material-ui/icons/Menu';
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';
import Badge from '@material-ui/core/Badge'; 
import { Tooltip, List, ListItem, Drawer, Container } from '@material-ui/core';
import { Link } from 'react-router-dom';
import headerStyle from '../../assets/styles/headerStyle';


class SignedIn extends Component{
	constructor(){
		super();
		this.state= {
			mobileOpen: false
		};
    this.handleDrawerToggle = this.handleDrawerToggle.bind(this);
	}

    componentDidMount(){
        console.log("signed in mounted");
    }

    componentWillUnmount(){
        console.log("signed in unmounted");
    }
    handleDrawerToggle() {
        this.setState((state) => ({
            mobileOpen: !state.mobileOpen
        }));
    };

	render(){
		const { classes} = this.props;
		return(
		//need to check auth when ready	
			<div className={classes.root}>
				<AppBar position = "static" className={classes.appBar} >
                    <Toolbar>
                      <Typography variant="h4" className={classes.title}>
                        Library X
                      </Typography>
                        <Tooltip title="Books" >
                            <IconButton component={Link} to="/" className={classes.link} color="inherit">
                                <ImportContactsRoundedIcon />           //book icon
                            </IconButton>
                        </Tooltip>
                        <Tooltip title="Profile" TransitionComponent={Fade} TransitionProps={{ timeout: 600 }}>
                            <IconButton component={Link} to="/profile" className={classes.link} color="inherit">
                                <AccountCircleIcon />                   //profile icon
                            </IconButton>
                        </Tooltip>

                      <Button color="inherit">Logout</Button>
                    </Toolbar>
                </AppBar>
                <Container>
                    {this.props.children}
                </Container>
			</div>
		);

	}
}

export default (withTheme(withStyles(headerStyle)(SignedIn)));
